import { Box, Container, Heading, Table, TableContainer, Th, Thead, Tr } from "@chakra-ui/react";

const TransactionRoute = () => {
    return(
        <>
       <Box alignItems="center" justifyContent="space-between" bg='gray.100' h='100vh' w='100%'>
            <Box bg="gray.200" p={5}>
               <TableContainer>
                <Table variant={'simple'}>
                    <Thead>
                        <Tr>
                        <Th>Sl No.</Th>
                        <Th>Transaction Ref</Th>
                        </Tr>
                    </Thead>

                </Table>
               </TableContainer>
            </Box>
       </Box>
        </>
    );
}

export default TransactionRoute;
